import axios from 'axios' ;
import {showError} from './actions /actions' ;


export default function deleteRequest(id){

    return dispatch => {
        axios.delete('http://localhost:4001/user/delete/' + id)
        .then(res => {
            console.log(res.data);
        })
        .catch(err => dispatch(showError(err)))
    }

}
